S:t Erikscupen måste också nämnas i sammanhanget, inte bara för att 3 av de 15 största tävlinga är deltävlingar i S:t Erikscupen, men ser man till alla deltävlingarna så har S:t Erik lockat till inte mindre än **386** starter. Det är svårt att överskatta vikten av denna tävling då den, för en stor mängd ungdomar, är det första trappsteget in till vidare tävlande. Hatten av till Stockholms Fäktförbund och alla klubbar, ledare och föräldrar som stäler upp med arrangemanget!

